    false,nt"url": null,nt"notes": "The USGS Central Region Energy Team assesses
    oil and gas resources of the United States. The onshore and State water areas of
    the United States comprise 71 provinces. Within these provinces, hydrocarbon plays
    or assessment units are defined and assessed. Each of these provinces is defined
    geologically, and most province boundaries are defined by major geologic changes.
    The province boundaries were drawn on the county lines that most closely followed
    the natural geologic boundaries.",nt"license_title": null,nt"extras": [{ntt"key":
